<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Snake AI - 10x10 Curriculum Agent</title>
    <link href="https://fonts.googleapis.com/css2?family=Inter:wght@400;600;700;900&family=JetBrains+Mono:wght@400;700&display=swap" rel="stylesheet">
    <style>
        * {
            margin: 0;
            padding: 0;
            box-sizing: border-box;
        }
        
        body {
            font-family: 'Inter', sans-serif;
            background: #0a0a0f;
            color: #e0e0e0;
            min-height: 100vh;
            display: flex;
            flex-direction: column;
            align-items: center;
            overflow-x: hidden;
        }

        /* Animated background gradient */
        body::before {
            content: '';
            position: fixed;
            top: 0; left: 0; right: 0; bottom: 0;
            background: 
                radial-gradient(ellipse at 20% 50%, rgba(120, 40, 200, 0.08) 0%, transparent 50%),
                radial-gradient(ellipse at 80% 20%, rgba(0, 200, 120, 0.06) 0%, transparent 50%),
                radial-gradient(ellipse at 50% 80%, rgba(30, 100, 220, 0.06) 0%, transparent 50%);
            z-index: -1;
            animation: bgShift 15s ease-in-out infinite alternate;
        }

        @keyframes bgShift {
            0% { opacity: 0.7; }
            100% { opacity: 1; }
        }

        .header {
            text-align: center;
            padding: 40px 20px 20px;
            width: 100%;
            max-width: 800px;
        }

        .header h1 {
            font-size: 2.2rem;
            font-weight: 900;
            background: linear-gradient(135deg, #00ff88, #00bbff, #8855ff);
            -webkit-background-clip: text;
            -webkit-text-fill-color: transparent;
            background-clip: text;
            letter-spacing: -0.5px;
        }

        .header .subtitle {
            font-size: 0.95rem;
            color: #666;
            margin-top: 8px;
            font-weight: 400;
        }

        .stats-bar {
            display: flex;
            gap: 20px;
            justify-content: center;
            margin: 20px 0;
            flex-wrap: wrap;
        }

        .stat {
            background: rgba(255,255,255,0.04);
            border: 1px solid rgba(255,255,255,0.08);
            border-radius: 12px;
            padding: 12px 20px;
            text-align: center;
            min-width: 100px;
            backdrop-filter: blur(12px);
        }

        .stat .label {
            font-size: 0.7rem;
            text-transform: uppercase;
            letter-spacing: 1.5px;
            color: #666;
            margin-bottom: 4px;
        }

        .stat .value {
            font-family: 'JetBrains Mono', monospace;
            font-size: 1.5rem;
            font-weight: 700;
        }

        .stat .value.score { color: #00ff88; }
        .stat .value.game { color: #00bbff; }
        .stat .value.step { color: #8855ff; }
        .stat .value.best { color: #ffaa00; }

        .game-container {
            position: relative;
            margin: 10px auto;
        }

        canvas {
            display: block;
            border-radius: 16px;
            box-shadow: 
                0 0 0 1px rgba(255,255,255,0.06),
                0 20px 60px rgba(0,0,0,0.5),
                0 0 80px rgba(0,200,100,0.08);
        }

        .controls {
            display: flex;
            gap: 10px;
            justify-content: center;
            margin: 20px 0;
            flex-wrap: wrap;
        }

        button {
            font-family: 'Inter', sans-serif;
            font-size: 0.85rem;
            font-weight: 600;
            padding: 10px 22px;
            border: 1px solid rgba(255,255,255,0.12);
            border-radius: 10px;
            background: rgba(255,255,255,0.05);
            color: #ccc;
            cursor: pointer;
            transition: all 0.2s;
            backdrop-filter: blur(8px);
        }

        button:hover {
            background: rgba(255,255,255,0.1);
            border-color: rgba(255,255,255,0.2);
            color: #fff;
            transform: translateY(-1px);
        }

        button.active {
            background: rgba(0,200,100,0.15);
            border-color: rgba(0,200,100,0.4);
            color: #00ff88;
        }

        .speed-label {
            display: flex;
            align-items: center;
            font-size: 0.8rem;
            color: #555;
            gap: 8px;
        }

        input[type="range"] {
            -webkit-appearance: none;
            appearance: none;
            width: 120px;
            height: 4px;
            background: rgba(255,255,255,0.1);
            border-radius: 2px;
            outline: none;
        }

        input[type="range"]::-webkit-slider-thumb {
            -webkit-appearance: none;
            appearance: none;
            width: 14px;
            height: 14px;
            border-radius: 50%;
            background: #00ff88;
            cursor: pointer;
        }

        .game-selector {
            display: flex;
            gap: 6px;
            justify-content: center;
            margin: 10px 0;
            flex-wrap: wrap;
        }

        .game-btn {
            font-family: 'JetBrains Mono', monospace;
            font-size: 0.75rem;
            padding: 6px 12px;
            min-width: 44px;
        }

        .game-btn.active {
            background: rgba(0,180,255,0.15);
            border-color: rgba(0,180,255,0.4);
            color: #00bbff;
        }

        .footer {
            text-align: center;
            padding: 20px;
            color: #333;
            font-size: 0.75rem;
        }

        .pipeline-tag {
            display: inline-block;
            font-size: 0.7rem;
            padding: 4px 10px;
            border-radius: 6px;
            background: rgba(136, 85, 255, 0.12);
            border: 1px solid rgba(136, 85, 255, 0.25);
            color: #aa88ff;
            margin-top: 6px;
            font-weight: 600;
            letter-spacing: 0.5px;
        }
    </style>
</head>

    <div class="header">

        <p class="subtitle">PPO + Curriculum Learning on 10√ó10 Board</p>

        <div class="stat">

    <div class="game-container">
        <canvas id="gameCanvas"></canvas>
    </div>

    <div class="controls">

        <div class="speed-label">

        </div>
    </div>

    <div class="game-selector" id="gameSelector"></div>

    <div class="footer">

                    if (dir[0] === 0) { // horizontal
                        ctx.beginPath();
                        ctx.arc(x + s / 2 + dir[1] * 4, y + s / 2 - eyeOff, eyeR, 0, Math.PI * 2);
                        ctx.fill();
                        ctx.beginPath();
                        ctx.arc(x + s / 2 + dir[1] * 4, y + s / 2 + eyeOff, eyeR, 0, Math.PI * 2);
                        ctx.fill();
                    } else { // vertical
                        ctx.beginPath();
                        ctx.arc(x + s / 2 - eyeOff, y + s / 2 + dir[0] * 4, eyeR, 0, Math.PI * 2);
                        ctx.fill();
                        ctx.beginPath();
                        ctx.arc(x + s / 2 + eyeOff, y + s / 2 + dir[0] * 4, eyeR, 0, Math.PI * 2);
                        ctx.fill();
                    }
                } else {
                    // Body segment - gradient from bright to darker toward tail
                    const t = i / Math.max(1, snake.length - 1);
                    const g = Math.round(lerp(80, 200, t));
                    ctx.fillStyle = `rgb(0, ${g}, ${Math.round(g * 0.55)})`;
                    ctx.beginPath();
                    roundRect(ctx, x + 3, y + 3, s - 6, s - 6, 8);
                    ctx.fill();
                }
            }

            // Game over overlay
            if (frame.game_over) {
                ctx.fillStyle = 'rgba(10, 10, 15, 0.65)';
                ctx.fillRect(0, 0, CANVAS_SIZE, CANVAS_SIZE);

                ctx.fillStyle = '#fff';
                ctx.font = '700 28px Inter';
                ctx.textAlign = 'center';
                ctx.fillText('Game Over', CANVAS_SIZE / 2, CANVAS_SIZE / 2 - 14);

                ctx.fillStyle = '#00ff88';
                ctx.font = '700 22px JetBrains Mono';
                ctx.fillText('Score: ' + frame.score, CANVAS_SIZE / 2, CANVAS_SIZE / 2 + 22);
            }
        }

        function roundRect(ctx, x, y, w, h, r) {
            ctx.moveTo(x + r, y);
            ctx.lineTo(x + w - r, y);
            ctx.quadraticCurveTo(x + w, y, x + w, y + r);
            ctx.lineTo(x + w, y + h - r);
            ctx.quadraticCurveTo(x + w, y + h, x + w - r, y + h);
            ctx.lineTo(x + r, y + h);
            ctx.quadraticCurveTo(x, y + h, x, y + h - r);
            ctx.lineTo(x, y + r);
            ctx.quadraticCurveTo(x, y, x + r, y);
            ctx.closePath();
        }

        // ===================== ANIMATION LOOP =====================
        function scheduleNext() {
            if (!playing) return;
            animTimer = setTimeout(() => {
                const frames = ALL_GAMES[currentGame];
                currentFrame++;
                if (currentFrame >= frames.length) {
                    // Pause at end for a bit, then go to next game
                    setTimeout(() => {
                        currentGame = (currentGame + 1) % ALL_GAMES.length;
                        currentFrame = 0;
                        selectGame(currentGame);
                        if (playing) scheduleNext();
                    }, 1500);
                    drawFrame();
                    return;
                }
                drawFrame();
                scheduleNext();
            }, speed);
        }

        // Start
        drawFrame();
        scheduleNext();
    </script>
</body>
</html>
